syntax = "proto3";

package timesup;

option java_package = "guru.bonacci.timesup.model";
option java_outer_classname = "TrackGeo";

message ConnectDefault1 {
  string TRACKING_NUMBER = 1;
  string MOVER_ID = 2;
  string UNMOVED_ID = 3;
  string UNMOVED_GEOHASH = 4;
  float UNMOVED_LAT = 5;
  float UNMOVED_LON = 6;
}
